    fetch('https://pokeapi.co/api/v2/pokemon/ditto')
    .then((response) => response.json())
    .then((data) => {
      console.log(data)
      setPokemon(data.species)
    }, [])
  })



  return <div> <h2>Result for: {props.query}</h2>
        </div>

}
